Defendant Kevin M Iwinski in court, in custody, with attorney Joan B Broughton.   Brian J Juech appeared for the State of Wisconsin.    Defendant enters a guilty plea to Count 1.  Court finds defendant guilty.

The Court Orders the Following:

Imposed and Stayed  Sentence

8 Years Imprisonment (Credit - 32 days )
- 3 Years of Initial Confinement
- 5 Years of Extended Supervision

Term of Probation: 3 Years

Conditions of Probation:
- AODA Assessment and follow through with any treatment recommended;
- Absolute Sobriety; Random U.A.s;
- No Use or Possession of alcohol or illegal drugs or drug paraphernalia;
- No Use or Possession of prescription drugs without a valid prescription;
- Any valid prescription drugs must be taken in the manner in which they are prescribed;
-  Inform agent of all prescriptions;
- Sign Medical Release for Agent;
- Maintain/Obtain full time employment;
- Provide DNA sample if not yet provided and pay surcharge;
- No contact with Jeremy P. and Francisco P..  No contact with Franciso P can be modified at the discretion of the agent.

Restitution: $355.00  ($235.00 to Francisco P and $120.00 to Mega Media Xchange)   
Costs: $ 278.00    
DNA Surcharge: $250.00    
(Restitution, costs and surcharge are to be paid within the first 2 years and 6 months of probation and paid to the agent)  ALL BAIL TO BE REFUNDED TO POSTER.

Condition Time:  6 months  (First 3 months STRAIGHT TIME last 3 months Huber NON WORKING HOURS WITH STANDARD RELEASE CONDITIONS)

Defendant is eligible for the Challenge Incarceration Program
Defendant is eligible for the Substance Abuse Program

Felony warnings, immigration warnings,  voting rights and firearms warnings given.
